         }

          public enable():void {
             if (this.isEnabled === true) return;
             // Add listeners and/or enable children.
             super.enable();
          }

          public disable():void {
             if (this.isEnabled === false) return;
             // Remove listeners and/or disable children.
             super.disable();
          }

          public destroy():void {
             super.destroy();
